(function() {  "use strict";
  jQuery(function($) {
    $('select#field_to_edit').on('variable_cost_of_good_ajax_data', function() {
      return {
        value: window.prompt(woocommerce_admin_meta_boxes_variations.i18n_enter_a_value)
      };
    });
    $('#the-list').on('click', '.editinline', function(e) {
      var cost, inline_data, post_id;
      post_id = $(this).closest('tr').attr('id');
      post_id = post_id.replace('post-', '');
      inline_data = $('#wc_cog_inline_' + post_id);
      cost = inline_data.find('.cost').text();
      return $('input[name="_wc_cog_cost"]').val(cost);
    });
    return $('#woocommerce-order-items').on('change', 'input.quantity', function(e) {
      var $cog_suggestion, $cog_total, $o_qty, $qty, $row, $unit_total;
      e.preventDefault();
      $row = $(this).closest('tr.item');
      $qty = $(this).val();
      $o_qty = $(this).attr('data-qty');
      $cog_total = $('input.cog-total', $row);
      $cog_suggestion = $('input.cog-suggestion', $row);
      $unit_total = accounting.unformat($cog_total.attr('data-cog-total'), woocommerce_admin.mon_decimal_point) / $o_qty;
      return $cog_suggestion.val(parseFloat(accounting.formatNumber($unit_total * $qty, woocommerce_admin_meta_boxes.rounding_precision, '')).toString().replace('.', woocommerce_admin.mon_decimal_point));
    });
  });

}).call(this);


